import Login from './pages/Login';
import './App.css';
import { BrowserRouter, Route, Routes } from 'react-router-dom';

function App() {
  return (
        <Routes>
          <Route path="/about">
            <Login />
          </Route>
        </Routes>
  );
}

export default App;
